import React, { useState } from 'react'
import './header.css'
import { Link } from "react-router-dom";
import camera from "./photo/camera.png"

const Header = () => {

    const [menuvar, setMenuvar] = useState<boolean>(false);
    const openmenu = () => {
        setMenuvar(true);
    }
    const closemenu = () => {
        setMenuvar(false);
    }

  return (
    <header>
        <button onClick={openmenu}>menu</button>
        { menuvar &&
        <ul>
            <li onClick={closemenu}>menu</li>
            <li className="element"><Link to="/">home</Link></li>
            <li className="element"><Link to="/photo_library">photo</Link></li>
            <li className="element"><Link to="/calculate">programming</Link></li>
        </ul>}
    </header>
  )
}

export default Header
